import React, { useEffect, useRef } from 'react';

function SplashCursor() {
  const canvasRef = useRef(null);

  useEffect(() => {
    const canvas = canvasRef.current;
    if (!canvas) return;

    // Canvas boyutunu ayarla
    const resizeCanvas = () => {
      canvas.width = window.innerWidth;
      canvas.height = window.innerHeight;
    };
    
    resizeCanvas();
    window.addEventListener('resize', resizeCanvas);

    const ctx = canvas.getContext('2d');
    let mouseX = window.innerWidth / 2;
    let mouseY = window.innerHeight / 2;
    let particles = [];
    let lastTime = 0;

    // Fluid benzeri renk geçişleri için
    const colors = [
      '#ff0000', '#00ff00', '#0000ff', '#ffff00', '#ff00ff', '#00ffff',
      '#ff4444', '#44ff44', '#4444ff', '#ffff44', '#ff44ff', '#44ffff'
    ];

    const handleMouseMove = (e) => {
      const newX = e.clientX;
      const newY = e.clientY;
      
      // Hızı hesapla
      const velocityX = newX - mouseX;
      const velocityY = newY - mouseY;
      const speed = Math.sqrt(velocityX * velocityX + velocityY * velocityY);
      
      mouseX = newX;
      mouseY = newY;

      // Hıza göre partikül sayısını ayarla
      const particleCount = Math.min(Math.floor(speed * 0.5), 15);
      
      // Mouse hareket edince yeni partikül ekle
      for (let i = 0; i < particleCount; i++) {
        const angle = Math.random() * Math.PI * 2;
        const spread = Math.random() * 50 + 20;
        
        particles.push({
          x: mouseX,
          y: mouseY,
          size: Math.random() * 4 + 2,
          speedX: velocityX * 0.5 + Math.cos(angle) * spread,
          speedY: velocityY * 0.5 + Math.sin(angle) * spread,
          color: colors[Math.floor(Math.random() * colors.length)],
          life: 60, // Daha uzun ömür
          rotation: Math.random() * Math.PI * 2,
          rotationSpeed: (Math.random() - 0.5) * 0.2
        });
      }
    };

    const animate = (timestamp) => {
      const deltaTime = timestamp - lastTime || 0;
      lastTime = timestamp;

      // Canvas'ı temizle (fluid efekti için hafif fade)
      ctx.fillStyle = 'rgba(255, 255, 255, 0.1)';
      ctx.fillRect(0, 0, canvas.width, canvas.height);

      // Partikülleri çiz ve güncelle (ÖNCE partiküller)
      for (let i = 0; i < particles.length; i++) {
        const p = particles[i];
        
        // Fizik güncellemeleri
        p.x += p.speedX * (deltaTime / 16);
        p.y += p.speedY * (deltaTime / 16);
        p.speedX *= 0.95; // Hava sürtünmesi
        p.speedY *= 0.95;
        p.speedY += 0.2; // Yerçekimi
        p.life--;
        p.rotation += p.rotationSpeed;

        // Fluid benzeri alpha geçişi
        const alpha = (p.life / 60) * 0.8;
        
        // Dairesel partiküller yerine fluid benzeri şekiller
        ctx.save();
        ctx.translate(p.x, p.y);
        ctx.rotate(p.rotation);
        
        // Fluid damlası benzeri şekil
        ctx.fillStyle = p.color.replace(')', `, ${alpha})`).replace('rgb', 'rgba');
        ctx.beginPath();
        
        if (Math.random() > 0.3) {
          // Elips şekli
          ctx.ellipse(0, 0, p.size, p.size * 0.6, 0, 0, Math.PI * 2);
        } else {
          // Düzensiz damla şekli
          ctx.moveTo(0, 0);
          for (let j = 0; j < 8; j++) {
            const angle = (j / 8) * Math.PI * 2;
            const radius = p.size * (0.8 + Math.random() * 0.4);
            ctx.lineTo(Math.cos(angle) * radius, Math.sin(angle) * radius);
          }
          ctx.closePath();
        }
        
        ctx.fill();
        ctx.restore();

        // Ölen partikülleri kaldır
        if (p.life <= 0 || p.y > canvas.height + 100) {
          particles.splice(i, 1);
          i--;
        }
      }

      // Ana cursor (fluid merkezi) - SONRA çiz
      ctx.fillStyle = 'rgba(255, 255, 255, 0.9)';
      ctx.beginPath();
      ctx.arc(mouseX, mouseY, 8, 0, Math.PI * 2);
      ctx.fill();

      ctx.fillStyle = 'rgba(255, 0, 0, 0.6)';
      ctx.beginPath();
      ctx.arc(mouseX, mouseY, 5, 0, Math.PI * 2);
      ctx.fill();

      ctx.fillStyle = 'rgba(255, 255, 255, 1)';
      ctx.beginPath();
      ctx.arc(mouseX, mouseY, 2, 0, Math.PI * 2);
      ctx.fill();

      requestAnimationFrame(animate);
    };

    window.addEventListener('mousemove', handleMouseMove);
    animate(0);

    return () => {
      window.removeEventListener('mousemove', handleMouseMove);
      window.removeEventListener('resize', resizeCanvas);
    };
  }, []);

  return (
    <div style={{
      position: 'fixed',
      top: 0,
      left: 0,
      zIndex: 9999,
      pointerEvents: 'none',
      width: '100%',
      height: '100%'
    }}>
      <canvas 
        ref={canvasRef}
        style={{
          width: '100%',
          height: '100%',
          display: 'block'
        }}
      />
    </div>
  );
}

export default SplashCursor;
